import { Link, useNavigate } from "react-router-dom";

export default function AdminNavbar(){

  const navigate = useNavigate();

  const logout = ()=>{
    localStorage.removeItem("adminToken");
    navigate("/admin/login");
  };

  return(
    <div className="bg-dark text-white p-3 mb-4">
      <div className="container d-flex justify-content-between">

        <div>
          <b>üè® Hotel Admin Panel</b>
        </div>

        <div>
          <Link className="btn btn-light mx-2" to="/admin/dashboard">
            Rooms
          </Link>

          <Link className="btn btn-warning mx-2" to="/admin/bookings">
            Bookings
          </Link>

          <Link className="btn btn-info mx-2" to="/admin/payments">
            Payments
          </Link>

          <button className="btn btn-danger" onClick={logout}>
            Logout
          </button>
        </div>

      </div>
    </div>
  );
}
